import React, { useEffect, useState } from "react";
import Dropdown from "muicss/lib/react/dropdown";
import DropdownItem from "muicss/lib/react/dropdown-item";
const test = [];
const Links = (props) => {
  const [lists, setList] = useState([]);
  test.push(props.record);
  useEffect(() => {
    if (test.length > 0) {
      setList(test);
    }
  }, [setList]);

  const toLink = (link) => {
    document.location.href = link;
  };

  return (
    <div
      style={{
        width: 200,
        height: 300,
        position: "absolute",
        backgroundColor: "red",
        right: 0,
        zIndex: 999,
      }}
    >
      {lists.map((item, index) => (
        <div onClick={() => toLink(props.record)}>{item}</div>
      ))}
    </div>
  );
};

export default Links;
